import React, { useEffect } from 'react'
import { Navigate, useNavigate } from "react-router-dom";
import './Dashboard.css'


const Dashboard = () => {
    const navigate = useNavigate();
    useEffect(() => {
        fetch('/admin', {
            method: "GET",
            headers: {
                Accept: "appllication/json",
                "Content-Type": "application/json"
            },
            credentials: "include"

        }).then((res) => {
            // dispatch({ type: "USER", payload: false })
            if (res.status === 404) {
                navigate('/Menu');

            }
        }).catch((err) => {
            console.log(err);
        });
    });

    return (
        <>
            <section className="section register min-vh-100 d-flex flex-column align-items-center  py-4" id="section">
                <div className="container">
                    <div className="row ">

                        <div class="card col-lg-4 dcard">
                            <div class="card-body">
                                <h3 class="card-title">Daily</h3>
                                <h4 class="card-text">10</h4>
                            </div>
                        </div>
                        <div class="card col-lg-4 dcard">
                            <div class="card-body">
                                <h3 class="card-title">Weekly</h3>
                                <h4 class="card-text">25</h4>
                            </div>
                        </div>
                        <div class="card col-lg-4 dcard">
                            <div class="card-body">
                                <h3 class="card-title">Monthly</h3>
                                <h4 class="card-text">15</h4>
                            </div>
                        </div>
                        <div class="card col-lg-4 dcard">
                            <div class="card-body">
                                <h3 class="card-title">Total</h3>
                                <h4 class="card-text">65</h4>
                            </div>
                        </div>

                    </div>
                </div>
            </section>
        </>
    )
}

export default Dashboard
